def min_stamps(amount, denominations):
    """"""
    dp = [float('inf')] * (amount + 1)
    dp[0] = 0
    for denomination in denominations:
        for i in range(denomination, amount + 1):
            dp[i] = min(dp[i], dp[i - denomination] + 1)
    if dp[amount] == float('inf'):
        return -1
    else:
        return dp[amount]
